import React, { useState, useEffect } from 'react';
import axios from 'axios';

const DatabaseManager = () => {
  const [records, setRecords] = useState([]);
  const [newRecord, setNewRecord] = useState({
    name: '',
    email: '',
    phone: '',
    message: '',
    company: '',
    location: '',
    time_stamp: ''
  });

  const fetchRecords = async () => {
    try {
      const response = await axios.get('http://localhost:5000/get-records');
      setRecords(response.data.records);
    } catch (error) {
      console.error('Error fetching records:', error);
    }
  };

  useEffect(() => {
    fetchRecords();
  }, []);

  const handleAddRecord = async () => {
    try {
      await axios.post('http://localhost:5000/add-record', newRecord); // Replace with your endpoint
      setNewRecord({
        name: '',
        email: '',
        phone: '',
        message: '',
        company: '',
        location: '',
        time_stamp: ''
      });
      fetchRecords();
    } catch (error) {
      console.error('Error adding record:', error);
    }
  };

  const handleDeleteRecord = async (recordId) => {
    try {
      await axios.delete(`http://localhost:5000/delete-record/${recordId}`);
      fetchRecords();
    } catch (error) {
      console.error('Error deleting record:', error);
    }
  };

  return (
    <div>
      <form onSubmit={handleAddRecord}>
        <input
          type="text"
          value={newRecord.name}
          onChange={(e) => setNewRecord({ ...newRecord, name: e.target.value })}
          placeholder="Name"
          required
        />
        <input
          type="text"
          value={newRecord.name}
          onChange={(e) => setNewRecord({ ...newRecord, email: e.target.value })}
          placeholder="Email"
          required
        />
        <input
          type="text"
          value={newRecord.name}
          onChange={(e) => setNewRecord({ ...newRecord, phone: e.target.value })}
          placeholder="Phone"
          required
        />
        <input
          type="text"
          value={newRecord.name}
          onChange={(e) => setNewRecord({ ...newRecord, message: e.target.value })}
          placeholder="Message"
          required
        />
        <input
          type="text"
          value={newRecord.name}
          onChange={(e) => setNewRecord({ ...newRecord, company: e.target.value })}
          placeholder="Company"
          required
        />
        <input
          type="text"
          value={newRecord.name}
          onChange={(e) => setNewRecord({ ...newRecord, location: e.target.value })}
          placeholder="Location"
          required
        />
        <button type="submit">Add Record</button>
      </form>

      <table>
        <thead>
          <tr>
            <th>Name</th>
            <th>Email</th>
            <th>Phone</th>
            <th>Message</th>
            <th>Company</th>
            <th>Location</th>
            <th>Actions</th>
          </tr>
        </thead>
        <tbody>
          {records.map((record) => (
            <tr key={record.id}>
              <td>{record.name}</td>
              <td>{record.email}</td>
              <td>{record.phone}</td>
              <td>{record.message}</td>
              <td>{record.company}</td>
              <td>{record.location}</td>
              <td>{record.time_stamp}</td>
              <td>
                <button onClick={() => handleDeleteRecord(record.id)}>Delete</button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default DatabaseManager;
